import React, { Component } from 'react';

class Landing extends Component {
  render() {
    return (
      <div>
        <header className="App-header">
          <img src={logo} alt="logo" />
          <a href="./Screens/Auth/Landing/index.js"> 
            <p>
            asdwadw</p>
          </a>
        </header>
      </div>
    );
  }
}

export default Landing;
